function DigitButton({dispatch, digit}) {
    return (
        <button
        onClick={() => {
        dispatch({type: ACTIONS.CHOOSE_OPERATION, payload: {digit}})
        }}>
            {digit}
        </button>
    )
}

export default OperationButton
